import{_ as e,o as i,c as a,O as t}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 32.1-277 Office of the Chief Medical Examiner; central and district offices and facilities.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/32.1-277.md","filePath":"vacode/32.1-277.md"}'),c={name:"vacode/32.1-277.md"},n=t('<h1 id="§-32-1-277-office-of-the-chief-medical-examiner-central-and-district-offices-and-facilities" tabindex="-1">§ 32.1-277 Office of the Chief Medical Examiner; central and district offices and facilities. <a class="header-anchor" href="#§-32-1-277-office-of-the-chief-medical-examiner-central-and-district-offices-and-facilities" aria-label="Permalink to &quot;§ 32.1-277 Office of the Chief Medical Examiner; central and district offices and facilities.&quot;">​</a></h1><p>The Commissioner shall establish and maintain, for the purpose of conducting medicolegal investigations of deaths and postmortem examinations, an Office of the Chief Medical Examiner, which shall include a central office and facilities and such district offices and facilities in such localities in the Commonwealth as may be necessary to carry out the provisions of this article. The central office and each district office established pursuant to this section shall be under the supervision of the Chief Medical Examiner. Each such office and facility shall have adequate professional, technical, and medical investigative personnel and physical facilities for the conduct of such examinations and investigations as may be authorized or required by law.</p><p>Code 1950, § 32-31.12; 1960, c. 366; 1972, c. 741; 1975, c. 475; 1979, c. 711; 1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0217" target="_blank" rel="noreferrer">217</a>; 2014, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0583" target="_blank" rel="noreferrer">583</a>; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0168" target="_blank" rel="noreferrer">168</a>.</p>',3),o=[n];function r(s,f,l,d,h,m){return i(),a("div",null,o)}const u=e(c,[["render",r]]);export{p as __pageData,u as default};
